import { MDBContainer, MDBCol } from "mdbreact";

function UserProfile() {
    return(
        <MDBCol className="profile pr-3 pb-4" md="3">
            <MDBContainer fluid className="profile_container">

            </MDBContainer>
        </MDBCol>
    )
}

export default UserProfile
